import React from 'react';
import { Typography, List, ListItem, ListItemText, Divider, Paper } from '@mui/material';

const transactions = [
  { date: '2024-08-18', description: 'Grocery', amount: -50, category: 'Food' },
  { date: '2024-08-17', description: 'Salary', amount: 1500, category: 'Income' },
  { date: '2024-08-16', description: 'Electricity Bill', amount: -75, category: 'Utilities' },
];

const TransactionHistory = () => {
  return (
    <Paper elevation={3} style={{ padding: '20px', marginBottom: '20px' }}>
      <Typography variant="h6" gutterBottom>
        Transaction History
      </Typography>
      <List>
        {transactions.map((transaction, index) => (
          <div key={index}>
            <ListItem>
              <ListItemText
                primary={`${transaction.description} - $${transaction.amount}`}
                secondary={`${transaction.date} | ${transaction.category}`}
              />
            </ListItem>
            {index < transactions.length - 1 && <Divider />}
          </div>
        ))}
      </List>
    </Paper>
  );
};

export default TransactionHistory;
